import React from 'react'

export default function BasketBackButton() {
    return (
        <div className="back">
            <img src="./images/mini/leftarrow.svg" alt="Картинка ушла за хлебом" className="back__arrow" />
            <span className="back__label">Вернуться к покупкам</span>
        </div>
    )
}
